// src/elements/Dashboard.js
import React from 'react';
import { Link, Outlet, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import '../style/Dashboard.css'; // Assuming you have a CSS file for styling

const Dashboard = () => {
  const navigate = useNavigate();
  const { logout } = useAuth();

  const handleLogout = async (e) => {
    e.preventDefault();
    try {
      await logout(); // Use logout method from context
      navigate('/login'); // Redirect to login page after successful logout
    } catch (error) {
      console.error('Logout failed', error);
      navigate('/login'); // Redirect to login page on failure
    }
  };

  return (
    <div className="dashboard-container">
      <div className="header">Dashboard</div>
      <nav className="dashboard-nav">
        <ul>
          <li><Link to="/tasks" className="button">Tasks</Link></li>
          <li><Link to="/categories" className="button">Categories</Link></li>
          <li><Link to="/settings" className="button">Settings</Link></li>
          <li><button onClick={handleLogout} className="button">Logout</button></li>
        </ul>
      </nav>
      <div className="dashboard-content">
        <Outlet />
      </div>
    </div>
  );
};

export default Dashboard;
